            â€¢
        </Box>
    );

    return (
        <div className='about-page'>
            <React.Fragment>
                <CssBaseline />
                <Container fixed>
                    <Box sx={{ bgcolor: '#f1f1f1', height: '80vh', margin: '10px auto', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
                        <img
                            src={myImg}
                            alt='About me'
                            style={{ maxWidth: '100%', maxHeight: '30vh' }}
                        />
                        <Typography variant="h6" component="div" sx={{ textAlign: 'center', paddingTop: '30vh', marginLeft: '15vh', marginRight: '15vh'}}>
                            Enthusiastic about coding and enjoy solving problems in creative ways. I'm a quick learner, an 'out-of-the-box' thinker, and a hard worker. I am adept at both collaborative teamwork and working independently, and I'm eager to expand my skills. Looking for afull/part-time position where I can learn and grow.
                        </Typography>
                    </Box>
                </Container>
            </React.Fragment>
        </div>
    );
}
export default AboutPage;
